import React ,{useState, useEffect} from 'react';
import Header from './header';
import Nav from './nav';
import Main from './main';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";


function AppAtlas(props) {
    let [name, setName]= useState("israel");
    useEffect(()=>{
        setName(name);

    },[])

    // const stateName =(_name)=>{
    //     setName(_name);

    // }
    return (
        <div >
            <Router>
              
                <Header />
                {/* <Nav name={name} setName ={setName}/>
                <Main name={name} setName= {setName}/> */}
                  <Switch>
                    <Route exact path={"/"} component={Nav} setName ={setName}/>
                    <Route exact path={"/"} component={Main} name={name} setName= {setName}/>
                </Switch>

            </Router>
        </div>
    )
}

export default AppAtlas
